package com.example.demo.repository;

import org.springframework.stereotype.Repository;
import com.example.demo.entity.Mascota;
import java.util.*;

@Repository
public class MascotaRepository  {

    private Map<Long, Mascota> data = new HashMap<>();

    public MascotaRepository(){
        data.put(1L, new Mascota("Firulais", "Pastor Aleman", 5, 20.0f, "Moquillo", "data:image/webp;base64,", true));
        data.put(2L, new Mascota("Rex", "Pitbull", 3, 15.0f, "Rabia", "data:image/jpeg;base64,", true));
        data.put(3L, new Mascota("Boby", "Chihuahua", 2, 5.0f, "Gripe", "data:image/jpeg;base64,", true));
    }

    public Mascota findById(Long id){
        return data.get(id);
    }

    public Collection<Mascota> findAll(){
        return data.values();
    }

    public void deleteById(Long id){
        data.remove(id);
    }

    public void update(Mascota mascota){
        data.put(mascota.getId(), mascota);
    }

    public void add(Mascota mascota){
        data.put(mascota.getId(), mascota);
    }
    
}